DECLARE nick_name_like VARCHAR(100); 
declare done int; 

DECLARE report_list_cur CURSOR FOR SELECT a.user_id,b.nick_name,a.report_id,a.study_report,a.create_date from user_study_report a,user_base_info b where a.user_id = b.user_id order by a.create_date limit 0, 10;
